INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '1', 'en_us', NULL, NULL, NULL, '2014-11-03 07:39:27', '2014-11-03 07:39:27', '110727fb-972c-40d9-bf6e-74c16c1073fd');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'en_us', 'Homepage', 'Welcome to Www.theanchor.com.ng!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Www.theanchor.com.ng will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', '2014-11-03 07:39:34', '2014-11-03 07:39:34', 'b944020c-54d4-418e-b778-105cb836ba28');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('3', '3', 'en_us', 'We just installed Craft!', NULL, '<p>Craft is the CMS that’s powering Www.theanchor.com.ng. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', '2014-11-03 07:39:35', '2014-11-03 07:39:35', '2c2e351f-9b77-4140-ac2e-5cf352773cab');
